import MyButton from "../../UI/MyButton/MyButton"


const MarksFrom = ({classes}) =>
{
    const TravelTo = () =>
    {
        window.location.href = "http://localhost:3000/marks"
    }
    return (
        <div className={classes.marksForm}>
            <MyButton onClick = {TravelTo}>Оценки</MyButton>
            <p>На вкладке "Отметки" вы можете ознакомится с успеваемостью школьников по разным дисциплинам,
            а также выставить или изменить уже существующие отметки</p>
        </div>
    )
}

export default MarksFrom;
